export default function sketch (p,x1) {
    p.setup = () => {
        p.createCanvas(600, 400).parent("parent");
    };
    p.draw = () => {
        p.background(0);
        p.fill(250);
        p.ellipse(80, 20, 50, 50);
        p.rect(x1, 20, 55, 55);
    };
};
